def highest_list(lists):
    max_num = float('-inf')
    max_list = None
    for l in lists:
        if max(l) > max_num:
            max_num = max(l)
            max_list = l
    return max_list
    

def create_graph(fitnum, num): 

    fig, ax = plt.subplots()
    title =  num + " Fitness Values"
    #print(title)
    ax.set_title(title)


    # Set the x-axis limits
    ax.set_xlim(1, 500)

    # Set the x-axis label
    ax.set_xlabel("# of Generations")

    # Set the y-axis label
    ax.set_ylabel("Fitness Scores")

# Plot the lists on the same graph
    ax.plot(fitnum[0], label="Seed 1 Optimal Fitness")
    ax.plot(fitnum[1], label="Seed 2 Optimal Fitness")
    ax.plot(fitnum[2], label="Seed 3 Optimal Fitness")
    ax.plot(fitnum[3], label="Seed 4 Optimal Fitness")
    ax.plot(fitnum[4], label="Seed 5 Optimal Fitness")
    ax.plot(fitnum[5], label="Seed 6 Optimal Fitness")
    ax.plot(fitnum[6], label="Seed 7 Optimal Fitness")
    ax.plot(fitnum[7], label="Seed 8 Optimal Fitness")
    ax.plot(fitnum[8], label="Seed 9 Optimal Fitness")
    ax.plot(fitnum[9], label="Seed 10 Optimal Fitness")

# Add a legend to the plot
    ax.legend()

# Display the plot
    plt.show()


def plot_bar_graph(data):
    colors = ['red', 'green', 'blue', 'yellow', 'cyan', 'magenta', 'orange', 'purple', 'brown', 'pink']
    x_values = list(range(1, 11))
    plt.bar(x_values, data)
    plt.bar(x_values, data, color=colors)
    plt.xlabel('# Random Seed')
    plt.ylabel('Highest Fitness Value')
    plt.title('Highest Fitness Values For 10 Best Morphologies')
    plt.xticks(x_values)
    plt.show()


def double_bar_graph(data1, data2):
    # Set the bar width
    bar_width = 0.35

    # Set the positions of the bars on the x-axis
    r1 = np.arange(len(data1))
    r2 = [x + bar_width for x in r1]

    # Plot the bars
    plt.bar(r1, data1, color='blue', width=bar_width, edgecolor='white', label='Total Links')
    plt.bar(r2, data2, color='green', width=bar_width, edgecolor='white', label='Sensor Neurons')

    # Add xticks on the middle of the group bars
    plt.xlabel('Random Seed')
    plt.ylabel('Number of Links')
    plt.xticks([r + bar_width/2 for r in range(len(data1))], ['Seed1', 'Seed2', 'Seed3', 'Seed4', 'Seed5', 'Seed6', 'Seed7', 'Seed8', 'Seed9', 'Seed10'])
    plt.title('Number of Total Links and Sensor Neurons For 10 Best Morphologies')

    # Add legend
    plt.legend()

    # Show graphic
    plt.show() 
